import React from 'react'

function teksti(){
    const reader = new FileReader()
    const t = reader.readAsText('./res/testi.txt')
    return t
}

function TextBox(props){
    
        return(
            <div className="offset-1">
                <h1>{props.text}</h1>
                <div>
                    <input type='text' value={teksti()}/>
                </div>
                <div>
                    <button onClick={props.onClick}>Vaihda Teksti</button>
                </div>
            </div>
        )
}

export default TextBox
